import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input to be visible
    await page.waitForSelector('#searchInput', { timeout: 5000 });

    // Click on the search category dropdown
    await page.click('.search-category');

    // Select the "Electronics" category
    await page.selectOption('.search-category', 'Electronics');

    // Take a screenshot after selecting the category
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_select_electronics.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_select_electronics.png'));

    // Click on the "Shop now" button for electronics
    await page.click('text=Shop now');

    // Wait for the electronics section to load
    await page.waitForSelector('.category-card', { timeout: 5000 });

    // Take a final screenshot to confirm navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_navigate_electronics.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_navigate_electronics.png'));

    return {
      success: true,
      action: "Navigated to Electronics Category",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
